import React from 'react';

export default function CogIcon({ className }) {
  return (
    <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor" className={className}>
      <path strokeLinecap="round" strokeLinejoin="round" d="M4.5 12a7.5 7.5 0 0115 0v0a7.5 7.5 0 01-15 0v0z" />
      <path strokeLinecap="round" strokeLinejoin="round" d="M12 15.75a3.75 3.75 0 100-7.5 3.75 3.75 0 000 7.5z" />
      <path strokeLinecap="round" strokeLinejoin="round" d="M12 3v.75m0 16.5V21m-6.75-12.75H3m18 0h-2.25m-13.5 9L5.25 15m13.5 0l-1.5-1.5M5.25 9l1.5-1.5m10.5 0l1.5 1.5" />
    </svg>
  );
}
